import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './pages/home.js';
import NavBar from './components/navbar.js';
import Service1 from './pages/service1';
import Service1_1 from './pages/service1_1';







function App() {

  return (
    <> 
    <NavBar/>
    {handleResize()}
     <Router>
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/service1' component={Service1} />
        <Route path='/service1_1' component={Service1_1} />


      </Switch>



    </Router>



    </>

  )
}
function handleResize(){
  console.log("test")
  //console.log('resized to: ', window.innerWidth, 'x', window.innerHeight)
  if(window.innerWidth<992){
    document.querySelector('.navbarY').style.position="relative";
    document.querySelector('.navbarY').style.right=0;
  }
  else{
      document.querySelector('.navbarY').style.position="absolute";
      document.querySelector('.navbarY').style.right=10;

  }
}


export default App;
